import React from 'react';
import Photo from '../../assets/img/people-having-a-drink-3641322.png';

const beer = () => {
    return (
        <div className='main_div'>
            <h1>MongoByte's Guide to U.S. Breweries</h1>
            <img src={Photo} className='main_img' alt='people having a drink' />
        </div>
    );
};

export default beer;
